import { useEffect, useState } from "react"

export default function CountryPage({ country, code  }) {
    const [countryInfo, setCountryInfo] = useState([]);
    useEffect(() => {
        fetch(`${process.env.REACT_APP_FRONT_URL}/getCountryInfo?code=${code}&country=${country}`)
        .then
    }, [])

    return (
        <></>
    )
}
